(347,	'2020-10-10 08:47:26',	'duploccom@massivemusic.fr',	'duploc.com',	'ecc19b2704c51d6ac273ff4d9e9c0cb2e6916370',	'ROBOT',	'dbc4fa29640f2bd8e158dec55d33789527c06582b771cffee102ade1cae08b5a18d5f594445b0d249cbbc3df8fcb1b6a3bbfb8d49ad848cfc4a4670691089f85',	NULL,	'2020-10-19 18:31:13.285',	'UCcdNy_FqMi0z1VU6kanOvFQ',	11,	NULL,	0,	'The leading platform for real dubstep.\n\nduploc.com is renowned to be one of the leading tastemakers for real dubstep. Originally we launched our brand in 2012 as a promotional outlet. Meanwhile we expanded to a full-fledged platform with our own live events, a prestigious record label ‘DUPLOC’ and a respected blog on which we document about exciting releases. In order to expose the deep dubstep sound, we are hosting the annual dubstep awards and are running the identity of dubstep mix series. In summary, it is our ambition to enrich the listener with a dependable view on the 140 culture.\n\nduploc.com is partnered with the record labels Albion Collective, Artikal Music, Chestplate, Crucial Recordings, Deep Dark & Dangerous, DEEP MEDi, Dub Police, DUPLOC, Encrypted Audio, FKOF, Gourmet Beats, H.E.N.C.H, Infernal Sounds, Innamind, Navy Cut, Rarefied, Scrub a Dub, Sentry Records, Subaltern Records, SYSTEM, Tempa, TRUSIK, Uprise Audio, Wheel & Deal, White Peach, ZamZam Sounds and many more.',	'https://yt3.ggpht.com/a/AATXAJyt6wLLwdcQfgTnME_XaesINnm-hhkHCLpx8sErGA=s88-c-k-c0x00ffffff-no-rj-mo',	'https://yt3.ggpht.com/a/AATXAJyt6wLLwdcQfgTnME_XaesINnm-hhkHCLpx8sErGA=s176-c-k-c0x00ffffff-no-rj-mo',	'https://yt3.ggpht.com/a/AATXAJyt6wLLwdcQfgTnME_XaesINnm-hhkHCLpx8sErGA=s176-c-k-c0x00ffffff-no-rj-mo'),
